import React from "react";

function HeaderText(props) {
  return (
    <div>
      <div className="header-text">
        <h1>
          {props.name}
          <br />
          <hr />
        </h1>
        <h2>
            {props.text}
        </h2>
      </div>
    </div>
  );
}

export default HeaderText;
